import React, { useEffect, useMemo, lazy, Suspense } from 'react';
import './App.css';
import Header from './components/Header';
import HeroSection from './components/HeroSection';
import ProblemStatement from './components/ProblemStatement';
// import Features from './components/Features';
import { createScrollObserver } from './lib/utils';

// Lazy load components that are not immediately visible
const HowItWorks = lazy(() => import('./components/HowItWorks'));
const SubscriptionPlans = lazy(() => import('./components/SubscriptionPlans'));
const DailyMenu = lazy(() => import('./components/DailyMenu'));
const Testimonials = lazy(() => import('./components/Testimonials'));
const DeliveryMap = lazy(() => import('./components/DeliveryMap'));
const FAQ = lazy(() => import('./components/FAQ'));
const Footer = lazy(() => import('./components/Footer'));

// Loading fallback component
const LoadingFallback = () => (
  <div className="flex items-center justify-center py-12">
    <div className="text-gray-600">Loading...</div>
  </div>
);

function App() {
  // Memoize intersection observer options for better performance
  const observerOptions = useMemo(() => ({
    threshold: 0.02, // Very low threshold for better performance
    rootMargin: '50px 0px', // Start animations earlier
  }), []);

  useEffect(() => {
    // Mark document as JS-enabled for CSS transitions
    document.body.classList.add('js-enabled');

    // Optimized intersection observer with better performance
    const observer = createScrollObserver((entries) => {
      // Use requestAnimationFrame for better performance
      requestAnimationFrame(() => {
        entries.forEach(entry => {
          if (entry.isIntersecting) {
            entry.target.classList.add('active');
            // Unobserve immediately after activating to improve performance
            observer.unobserve(entry.target);
          }
        });
      });
    }, observerOptions);

    // Batch DOM operations
    const setupObserver = () => {
      const fadeElements = document.querySelectorAll('.section-fade');

      if (fadeElements.length > 0) {
        fadeElements.forEach(section => {
          observer.observe(section);
        });
      }
    };

    // Use minimal timeout for DOM setup
    const timeoutId = setTimeout(setupObserver, 50);

    return () => {
      clearTimeout(timeoutId);
      observer.disconnect();
    };
  }, [observerOptions]);

  return (
    <div className="font-sans text-gray-800 bg-white overflow-x-hidden min-h-screen">
      <Header />
      <main className="relative">
        <HeroSection />
        <ProblemStatement />
        {/* <Features /> */}

        {/* Lazy loaded components with suspense */}
        <Suspense fallback={<LoadingFallback />}>
          <DailyMenu />
        </Suspense>

        <Suspense fallback={<LoadingFallback />}>
          <SubscriptionPlans />
        </Suspense>

        <Suspense fallback={<LoadingFallback />}>
          <HowItWorks />
        </Suspense>

        <Suspense fallback={<LoadingFallback />}>
          <Testimonials />
        </Suspense>

        <Suspense fallback={<LoadingFallback />}>
          <DeliveryMap />
        </Suspense>

        <Suspense fallback={<LoadingFallback />}>
          <FAQ />
        </Suspense>
      </main>

      <Suspense fallback={<LoadingFallback />}>
        <Footer />
      </Suspense>
    </div>
  );
}

export default App;
